contracts/HelloWorld.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

contract HelloWorld  {


     string public cuongMessage;
        string[] public lichSuDauGia;

    constructor(string memory initialMessage) {
        cuongMessage = initialMessage;
    }

    function sayHelloWorld() public pure returns (string memory) {
        return "Hello World";
    }

    function sayCuong() public view returns (string memory) {
        return cuongMessage;
    }

    function updateCuongMessage(string memory newMessage) public {
        cuongMessage = newMessage;
    }

    
}

